function displayModal() {
	const modal = document.getElementById("contact_modal");
	if (modal) {
		modal.style.display = "block";
	}
}
function closeModal() {
	const modal = document.getElementById("contact_modal");
	if (modal) {
		modal.style.display = "none";
	}
}
